script: |
  super -f text -I q5530.spq | sort > q5530.out

inputs:
  - name: q5530.spq
    data: |
      SELECT DISTINCT tab1.col1 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT + tab1.col0 / col0 - - col1 IN ( col1 * col0 * - tab1.col2 + - col0 * col1 );
  - name: tab1

outputs:
  - name: q5530.out
    data: |
      10
      13
      26
